// Function to decrypt data
function decryptData(t) {
    const key = CryptoJS['enc']['Utf8']['parse']('wijrKSCUiQuGbrwsgyEMyIx7Uogmfe85'); // Replace with your actual secret key
    const iv = CryptoJS['enc']['Utf8']['parse']('ho6KJIIz9WV7nozZl5fVnG7MtDUcSUB1'); // Replace with your actual initialization vector

    console.log(t)
    const hexCiphertext = base64ToHex(t)
    const decryptedBytes = CryptoJS['AES']['decrypt']({
        ciphertext: CryptoJS['enc']['Hex']['parse'](hexCiphertext)
    }, key, {
        iv: iv,
        mode: CryptoJS['mode']['CBC'],
        padding: CryptoJS['pad']['Pkcs7']
    });

    return decryptedBytes.toString(CryptoJS['enc']['Utf8']);
}

// Function to parse base64-encoded ciphertext into a byte array
function parseBase64Ciphertext(base64Ciphertext) {
    const map = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/=";
    base64Ciphertext = base64Ciphertext.replace(/\s/g, '');

    let length = base64Ciphertext.length;
    let paddingChar = map.charAt(64);

    if (paddingChar && base64Ciphertext.indexOf(paddingChar) !== -1) {
        length = base64Ciphertext.indexOf(paddingChar);
    }

    const result = [];
    let outputIndex = 0;

    for (let i = 0; i < length; i++) {
        if (i % 4) {
            const upperBits = map.indexOf(base64Ciphertext.charAt(i - 1)) << (i % 4 * 2);
            const lowerBits = map.indexOf(base64Ciphertext.charAt(i)) >>> (6 - i % 4 * 2);
            result[outputIndex >>> 2] |= (upperBits | lowerBits) << (24 - outputIndex % 4 * 8);
            outputIndex++;
        }
    }

    return result;
}

